import React from "react";
import "bulma/css/bulma.css";
import _ from "underscore";
import Banner from "./components/Banner";
import Tools from "./components/Tools";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      firstVar: "Our page loaded",
      secondVar: 50,
      name: "Robert"
    };
  }
  solve = () => {
    console.log("solve")
  }
  stop = () => {
    console.log("stop")
  }
  newGame = () => {
    console.log("new game")
  }
  deleteGame = () => {
    console.log("delete game")
  }
  getThisAsStr = () => {
    console.log("getThisAsStr")
  }
  componentDidMount() {

  }
  render() {
    return (
      <div>
        <Banner />
        <Tools solve={this.solve} 
        stop={this.stop}
        />
      </div>
    );
  }
}

export default App;
